import React from "react";

function Vision() {

    return (
        <div className="visionBody">
            <h3 className="visionH3">Vår vision</h3>
            <p className="visionP">Våra medlemmar är experter som leder <br /><br />
            näringslivs- och samhällsutvecklingen genom innovation och förädlingsprocesser.<br />
            De driver skapandet av nästa generations hållbara byggnader, <br />
            av framtidens infrastruktur och framtagandet av morgondagens <br />
            tekniska och affärsmässiga lösningar. Innovations företagens medlemmar <br />
            står för en mycket stor del av den forskning och innovation som bedrivs <br />
            inom arkitekt- och ingenjörsområdet i Sverige. På en global marknad är branschen <br />
            en drivande aktör för att bidra med högkvalificerad kunskap och forskning <br />
            till både näringsliv och offentlig sektor.
            </p>
        </div>
    );
}
export default Vision;
